import React from 'react';
import { connect } from 'react-redux';

import Building from './Building';
import '../../css/buildings.css';

class BuildingsSet extends React.Component {

  render() {
    console.log("BuildingsSet");

    return (
      <div className="buildings">
        {this.props.initialBuilding[0].title}
        {this.props.initialBuilding.map((building, index) =>
          <Building key={building} index={index} title={building} />
        )}
      </div>
    );
  }
}

const mapStateToProps = state => {
  return {
    initialBuilding: state.initialBuilding
  }
};

export default connect(mapStateToProps)(BuildingsSet);
